def main():
    n = int(input())
    a = list(map(int, input().split()))
    b = []
    for i in range(n):
        b.append(a[i])
        b.reverse()
    print(" ".join(map(str, b)))

if __name__ == '__main__':
    main()

n = int(input())
a = list(map(int, input().split()))

if n % 2 == 0:
    b = a[n//2:] + a[:n//2]
else:
    b = a[n//2 + 1:] + a[:n//2 + 1]

for i in range(n):
    if i % 2 == 0:
        print(b[i], end=' ')
    else:
        print(b[i], end=' ')
